import React from 'react';
import '../index.css';

const Header = ()=> {
    return(
        <>
            <div className='Header'>
               <div className='title'>
                    <h1><span>K</span>umar</h1>
                    <h1><span>M</span>edicine</h1>
               </div>
                
            </div>
        </>
    )
}

export default Header;
